import React from 'react';
import axios from 'axios';

function App() {
  const handleSubmit = async () => {
    await axios.get('http://localhost:3001');
  };
  return (
    <div className='App'>
      <h1>CLick this button</h1>
      <button onClick={handleSubmit}>CLick me</button>
    </div>
  );
}

export default App;
